import React from "react";
import { Route, Routes } from "react-router-dom";
import Main from "./pages/main";

function App() {
  return (
    <React.Fragment>
      <Routes>
        <Route path="/" element={<Main />} >
          <Route></Route>
        </Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
